        "plugins.membership.FAQ.whatIsMemberships.question": "Was ist MEE6 Monetize?",
        "plugins.membership.FAQ.whatIsMemberships.answer": "Mit MEE6 Monetize kannst du den Zugang zu deinem gesamten Discord-Server oder zu bestimmten Rollen und Channels auf deinem Discord-Server verkaufen. Es ist eine einfache, vielseitige und problemlose Möglichkeit, deine Community zu monetarisieren.",
        "plugins.membership.FAQ.howItWorks.question": "Wie funktioniert MEE6 Monetize?",
        "plugins.membership.FAQ.howItWorks.answer": "Mit Monetize kannst du mehrere Pläne mit unterschiedlichen Preisen erstellen. Du kannst deine Pläne anpassen, indem du ihnen einen schönen Namen und ein Symbol gibst. Du erhältst dann eine öffentliche Monetize-Seite, auf der jeder deinen Plan per Kreditkarte abonnieren kann. Immer wenn jemand deinen Plan abonniert, kann er deinem Discord Server beitreten und erhält automatisch die Rollenvorteile, die du in deinem Plan eingerichtet hast. Du erhältst dann sofort das Abonnementgeld auf dein Stripekonto und kannst es über dein Stripe Dashboard direkt auf dein Bankkonto überweisen.",
        "plugins.membership.FAQ.whatIsPlan.question": "Was ist ein Plan?",
        "plugins.membership.FAQ.whatIsPlan.answer": "Jeder Plan hat einen Preis und eine oder mehrere Rollen, die vergeben werden, wenn sich jemand anmeldet. Du kannst mehrere Pläne haben. Wenn jemand einen deiner Pläne abonniert, wird ihm der Preis des Plans jeden Monat zum gleichen Datum in Rechnung gestellt, zu dem er ihn abonniert hat. Beispiel: Wenn jemand am 10.04.2021 ein Abonnement abgeschlossen hat, verlängert sich dieses am 10.05.2021 usw., bis er sich entscheidet, sein Abonnement zu kündigen.",
        "plugins.membership.FAQ.paymentMethods.question": "Welche Zahlungsarten werden unterstützt?",
        "plugins.membership.FAQ.paymentMethods.answer": "Derzeit können sich deine Mitglieder mit einer Bank-/Kreditkarte anmelden, die wiederkehrende Zahlungen unterstützt. Wir arbeiten mit Stripe zusammen, um eine große Auswahl an Bank-/Kreditkarten zu unterstützen und sicherzustellen, dass die Kartendaten deiner Abonnenten geschützt sind.",
        "plugins.membership.FAQ.creditCardData.question": "Behaltet ihr die Kreditkarten-Informationen meiner Abonnenten?",
        "plugins.membership.FAQ.creditCardData.answer": "Wir haben keinen Zugriff auf oder speichern keine Kreditkarteninformationen deiner Abonnenten oder deiner Bankkontoinformationen. Wir arbeiten mit Stripe zusammen, einem Branchenführer in der Zahlungsabwicklung, um Kreditkartenzahlungen abzuwickeln. Stripe bewahrt die Kreditkarteninformationen deiner Abonnenten auf und verwendet sie, um die Verlängerungszahlungen deiner Abonnenten abzuwickeln.",
        "plugins.membership.FAQ.getMoney.question": "Wann und wie erhalte ich mein Geld?",
        "plugins.membership.FAQ.getMoney.answer": "Mit der Stripe-Zahlungsmethode erhältst du dein Geld direkt auf dein Stripe-Konto, sobald jemand eines deiner Angebote abonniert. Wir behalten nichts von deinem Geld, es geht direkt auf dein Stripe-Konto und wird ein paar Werktage nach der Zahlung automatisch auf dein Bankkonto überwiesen.",
        "plugins.membership.FAQ.cost.question": "Wie hoch sind die Kosten?",
        "plugins.membership.FAQ.cost.answer": "Wir wollen nur erfolgreich sein, wenn Sie es auch sind! Deshalb haben wir uns für ein Pay-as-you-go-Preismodell entschieden. Wir nehmen 5,0% von jeder Transaktion zusätzlich zu den Stripe-Gebühren. Das heißt, wenn jemand einen $5-Monatsplan abonniert, nehmen wir $0,25 pro Monat ein, solange das Abonnement aktiv ist. Es gibt keine Einrichtungsgebühren oder versteckte Gebühren, wir verdienen erst dann Geld, wenn Sie es tun.",
        "plugins.membership.FAQ.cancelSubscription.question": "Können meine Abonnenten ihr Abonnement kündigen?",
        "plugins.membership.FAQ.cancelSubscription.answer": 'Deine Abonnenten können dein Abonnement jederzeit über die Seite "Abonnementverwaltung" kündigen. Wenn sie ihr Abonnement kündigen, wird es nicht erneuert, aber sie haben ihre Vorteile noch aktiv, bis sie die verbleibenden Tage, für die sie bezahlt haben, verbraucht haben.',
        "plugins.membership.FAQ.refundSubscribers.question": "Kann ich meinen Abonnenten das Geld zurückerstatten?",
        "plugins.membership.FAQ.refundSubscribers.answer": "Wenn du Stripe als Zahlungsmethode verbunden hast, kannst du deinen Abonnenten über dein Stripe-Dashboard Rückerstattungen erteilen.",
        "plugins.membership.FAQ.remindSubscribers.question": "Werden meine Abonnenten jeden Monat eine Zahlungserinnerung erhalten?",
        "plugins.membership.FAQ.remindSubscribers.answer": "Nein, die Kosten für das Abonnement werden automatisch über die Zahlungsmethode abgebucht, die sie beim ersten Mal verwendet haben.",
        "plugins.membership.FAQ.failedPayments.question": "Was passiert, wenn diese automatische Aufladung fehlschlägt?",
        "plugins.membership.FAQ.failedPayments.answer": "Die Abbuchung wird noch 7 Tage lang versucht. Schlägt sie dann weiterhin fehl, wird das Abonnement gekündigt.",
        "plugins.membership.FAQ.translationMissing.question": "Die öffentliche Seite Monetize ist in meiner Sprache nicht verfügbar, ist das normal?",
        "plugins.membership.FAQ.translationMissing.answer": "Ja, unsere Übersetzer arbeiten noch daran. Sobald die Übersetzungen fertig und genehmigt sind, werden sie bald veröffentlicht.",
        "plugins.membership.FAQ.taxForms.question": "Wie führe ich diese zusätzlichen Einnahmen in meinen Steuerformularen auf?",
        "plugins.membership.FAQ.taxForms.answer": "Falls du in den USA ansässig bist, wirst du bei der Einrichtung von Stripe nach den entsprechenden Informationen gefragt, und deine 1099-K- und 1099-MISC-Formulare werden automatisch ausgefüllt. Einwohner anderer Länder müssen sich selbst um ihre Steuern kümmern, entsprechend ihrer lokalen Gesetze.",
        "plugins.membership.onboarding.step0.title": "Verdiene ein Einkommen mit deinem Discord-Server",
        "plugins.membership.onboarding.step0.description": "Erstelle monatliche Abonnements, die deine Mitglieder im Austausch gegen Rollen, Zugang zu privaten Channels und andere Vergünstigungen abschließen können. Mache deinen Discord-Server zu deinem Lebensunterhalt.",
