        "plugins.reddit.edit.embedType": "Einbettungen",
        "plugins.reddit.edit.name": "Subreddit-Name",
        "plugins.reddit.edit.channel": "In Kanal senden",
        "plugins.reddit.search": "Gefundene Subreddits",
        "public.plugins.engagementFun.meta.description": "Verbesser deinen Discord-Server mit dem MEE6 Game Bot. Halte deine Community aktiv und engagiert mit fortschrittlichem Leveling-System, anpassbaren Profilkarten, Gewinnspielen und einem Wirtschafts-Plugin. Außerdem verpasst du mit der Geburtstagsbenachrichtigungsfunktion von MEE6 nie wieder einen Geburtstag.",
        "public.plugins.engagementFun.hero.title": "Der beste Discord-Spiel-Bot",
        "public.plugins.engagementFun.levels.title": "Fortgeschrittenes Discord-Leveling-System",
        "public.plugins.engagementFun.levels.description": "Steiger deine Serveraktivität, indem du deine Mitglieder mit XP belohnst, wenn sie eine Nachricht senden. Verwende deine Server-Rangliste, um deine aktivsten Mitglieder zu verfolgen.",
        "public.plugins.engagementFun.rankCards.title": "Anpassbare Profilkarte",
        "public.plugins.engagementFun.rankCards.description": "Richte das MEE6 Leveling Plugin ein und gib jedem deiner Mitglieder eine coole Profil-/Rangkarte. Die Karte zeigt den aktuellen Fortschritt deines Mitglieds und seinen Rang an. Du kannst die Karte auf deinem Server anpassen, indem du den Hintergrund und die Farbe änderst, so dass sie zu deinem Server-Look & Feel passt.",
        "public.plugins.engagementFun.giveaways.title": "Discord Gewinnspiele schnell und einfach veranstalten",
        "public.plugins.engagementFun.giveaways.description": "Verwende MEE6, um Gewinnspiele auf deinem Discord-Server durchzuführen. Du kannst benutzerdefinierte Preise, XP-Punkte-Preise und sogar eine Feinabstimmung der Gewinnchancen für die Verlosung konfigurieren. Gewinnspiele sind großartig, um deine Community engagiert und aktiv zu halten.",
        "public.plugins.engagementFun.economy.title": "Gestalte deinen Discord Server spielerisch mit der Wirtschaftsfunktion von MEE6",
        "public.plugins.engagementFun.economy.description": "Mit dem Wirtschafts-Plugin von MEE6 kannst du deine eigene Währung, Gegenstände und bezahlte Rollen auf deinem Discord-Server erstellen. Deine Mitglieder erhalten einmal pro Tag Münzen, wenn sie den Befehl /daily eingeben. Sie können weitere Münzen verdienen, indem sie Spiele wie Roulette, Stein-Schere-Papier und mehr spielen!",
        "public.plugins.engagementFun.birthdays.title": "Discord-Geburtstagsbenachrichtigung",
        "public.plugins.engagementFun.birthdays.description": "MEE6 kann sich die Geburtstage von Mitgliedern merken und ihnen an ihrem Geburtstag eine Nachricht in einem bestimmten Kanal schicken. Du kannst ihnen auch eine besondere Rolle für diesen Tag zuweisen!",
        "public.plugins.engagementFun.music.title": "Höre Musik mit deinen Freunden direkt in Discord",
        "public.plugins.engagementFun.music.description": "Mit dem stabilsten und intuitivsten Musik-Bot kannst du mit deinen Freunden direkt von deinem Discord-Server aus Musik hören.\n\nKeine komplizierten Befehle mehr, um deine Musik abzuspielen und deine Wiedergabeliste zu verwalten. Nutze unser cooles Dashboard, um direkt nach Songs zu suchen, sie wiederzugeben und sie auf deinem Discord-Server abzuspielen.",
        "public.customBot.meta.description": "Passe mit dem Bot Personalisierer von MEE6 den Avatar, den Benutzernamen, die KI-basierte Hintergrundgeschichte und die Aktivitäten deines Discord Bots an das Branding und den Ton deines Servers an. Gestalte eine professionelle und einprägsame Serveridentität in nur wenigen Minuten, ohne dass du programmieren lernen musst. Profitiere von der Leistungsfähigkeit der MEE6-Plugins und dem 24/7-Hosting ohne zusätzliche Kosten.",
        "public.customBot.hero.title": "Erstellen deinen eigenen Discord-Bot",
        "public.customBot.hero.description": "Passe deinen Bot an, indem du seinen Avatar, seinen Namen und seine Aktivität änderst und die Leistung der MEE6-Plugins nutzt.",
        "public.customBot.hero.cta": "Premium ansehen",
        "public.customBot.create.title": "Passe die Persönlichkeit und Ästhetik deines Servers an",
        "public.customBot.create.description": "Passe den Namen, die Hintergrundgeschichte, den Avatar und den Status deines Bots an. Ein einheitliches und markengerechtes Erscheinungsbild deines Servers ist einer der Eckpfeiler einer starken Community. Gestalte ein professionelles Erscheinungsbild, das zu deinem Server passt und dazu beiträgt, Vertrauen innerhalb deiner Community aufzubauen.",
        "public.customBot.customize.title": "Erschaffe eine einprägsame Serveridentität",
        "public.customBot.customize.description": "Die Bot-Personalisierungsfunktion ermöglicht es dir, eine einzigartige und starke Identität für deinen Server zu schaffen, an die sich deine Mitglieder erinnern werden. Indem du deinen Bot anpasst, kannst du deinen Server von der Masse abheben und einen bleibenden Eindruck hinterlassen.",
        "public.customBot.backstory.title": "KI-gestützte Hintergrundgeschichten",
        "public.customBot.backstory.description": "Unsere KI-Engine kann tiefgründige Hintergrundgeschichten für deinen Bot generieren. Wie wäre es mit einem Rick Sanchez, der in Reimen zu dir spricht, oder einem Harry Potter, der magische Geheimnisse verrät? Alles ist möglich.",
        "public.customBot.steps.title": "Richte deinen eigenen Bot in unter 3 Minuten ein",
        "public.customBot.steps.description": "Du musst nicht lernen, wie man programmiert. Du kannst deinen eigenen Bot einrichten und die Leistung der Plugins von MEE6 genießen! Wir hosten den Bot 24/7 für dich, ohne zusätzliche Kosten!",
        "public.customBot.unlock": "Bot Personalisierer freischalten",
        "public.premium.hero.title": "Bring deinen Server auf das nächste Level",
        "public.premium.hero.description": "Schöpfe das volle Potenzial deines Servers aus, indem du uneingeschränkten Zugriff auf alle Funktionen und Plugins von MEE6 erhältst",
        "public.premium.hero.title2": "Pläne für alle Größen",
        "public.premium.hero.description2": "Bringe deinen Server mit unseren MEE6 Premium-Abonnements durch noch mehr Funktionen auf die nächste Stufe!",
