        "plugins.reaction_roles.templates.verify.embed.description": "Willkommen auf unserem Server!\n\nBitte verifiziere dich durch Anklicken des ✅-Emojis unten, um Zugang zu allen Funktionen und Kanälen zu erhalten.\n\nSobald du verifiziert bist, kannst du dich voll und ganz in unsere Community integrieren und an allen unseren Veranstaltungen und Aktivitäten teilnehmen.",
        "plugins.reaction_roles.templates.notifications.title": "📨 Benachrichtigungen",
        "plugins.reaction_roles.templates.notifications.name": "Benachrichtigungen",
        "plugins.reaction_roles.templates.notifications.description": "Nutzer wählen Benachrichtigungskanäle aus",
        "plugins.reaction_roles.templates.notifications.embed.title": "🔔 Hey, Notification Squad!",
        "plugins.reaction_roles.templates.notifications.embed.description": "Wir möchten sicherstellen, dass du immer auf dem Laufenden bist, was das Neueste und Beste auf unserem Server ist. Deshalb haben wir ein paar tolle Benachrichtigungen nur für dich eingerichtet! 🔔\n\n👉 Um auszuwählen, worüber du benachrichtigt werden möchtest, klicke einfach auf die Knöpfe unten! Du kannst eine oder alle Optionen auswählen, es liegt ganz bei dir!\n\n📣 Ankündigungsbenachrichtigungen: Sei der Erste, der über wichtige Updates und Neuigkeiten informiert wird!\n🎬 Livestream-Benachrichtigungen: Verpasse keinen Moment unserer Streams, Spiele-Sessions und mehr!\n🎉 Event-Benachrichtigungen: Erhalte Erinnerungen und Updates für all die lustigen Events, die wir geplant haben!\n🚀 Produkt-Update-Benachrichtigungen: Bleibe auf dem Laufenden mit den neuesten und besten Informationen von unserem Produktteam!\n🗳️ Abstimmungsbenachrichtigungen: Verschaffe dir Gehör mit Benachrichtigungen über alle anstehenden Umfragen und Abstimmungen!\n🐦 Tweet-Benachrichtigungen: Unterstütze uns, indem du unsere neuesten X-Posts likest, kommentierst und retweetest!\n\nDanke, dass du Teil unserer Community bist, und wir hoffen, dich bald wiederzusehen! 🎉",
