        "plugins.reaction_roles.templates.continents.embed.title": "Möchtest du andere Menschen von deinem Kontinent sehen?",
        "plugins.reaction_roles.templates.continents.embed.description": "Hey! Fühlst du dich ein bisschen verloren ohne eine regionale Rolle? Keine Sorge, drück einfach auf den leuchtenden Knopf unten und du bekommst im Handumdrehen eine solche.\n\nAber warte, was ist, wenn du bereits eine Regionalrolle hast und sie dir nicht mehr gefällt? Kein Problem! Drücke einfach noch einmal auf denselben Button und du bist im Handumdrehen rollenfrei.\n\nEasy-peasy, lemon-squeezy! 🍋",
