        "plugins.reaction_roles.templates.zodiac.embed.description": "Bist du ein feuriger Widder oder ein sensibler Krebs? Vielleicht bist du ein schräger Wassermann oder ein essensliebender Stier? Was auch immer dein Sternzeichen ist, wir haben ein paar tolle Sternzeichen-Emotes für dich!\n\n🔥 Um dein Sternzeichen zu wählen, reagiere einfach auf diesen Beitrag mit dem entsprechenden Emote unten:\n\n♈️ Widder\n♉️ Stier\n♊️ Zwillinge\n♋️ Krebs\n♌️ Löwe\n♍️ Jungfrau\n♎️ Waage\n♏️ Skorpion\n♐️ Schütze\n♑️ Steinbock\n♒️ Wassermann\n♓️ Fische\n\nMal sehen, welche Zeichen unseren Server dominieren! 🔮",
