        "premium.faq.lifetime.title": 'Warum wird mein Lifetime Premium-Abonnement als "wird in 15 Jahren erneuert" angezeigt?',
        "premium.faq.lifetime.text": "Dies ist lediglich eine technische Einschränkung unserer Systeme. Dir werden in 15 Jahren keine Gebühren berechnet.",
        "premium.faq.free_credits.title": "Was sind MEE6-Gutschriften?",
        "premium.faq.free_credits.text": "Kostenlose Credits werden an Serverbesitzer vergeben, wenn Mitglieder eines Servers den Befehl /vote verwenden und für MEE6 abstimmen. Für jede Abstimmung erhalten die Serverbesitzer einen Credit-Äquivalentwert. Der Gegenwert der Credits kann dann bei der nächsten Zahlung eines MEE6-Abonnements verwendet werden, so dass die Community kostenlos von den MEE6-Premiumfunktionen profitiert. Die Anzahl der Stimmen und der Guthabenäquivalenzwert werden einmal pro Tag aktualisiert.",
        "premium.faq.buy_with_free_credits.title": "Wenn ich einen neuen Tarif mit meinem kostenlosen Guthaben kaufe, wann sehe ich dann den ermäßigten Preis?",
        "premium.faq.buy_with_free_credits.text": 'Kostenlose Guthaben werden vom Preis eines Abonnements abgezogen, wenn du auf der Premiumseite auf die Schaltfläche "Weiter zur Zahlung" klickst. Du kannst dort dann den abgezogenen Kreditbetrag überprüfen und sicherstellen, dass alles in Ordnung ist, bevor du mit der Zahlung fortfährst',
        "premium.faq.currency.title": "Kann ich in einer anderen Währung bezahlen?",
        "premium.faq.currency.text": "Die einzige verfügbare Währung ist die angezeigte Währung. Du kannst jedoch auch in deiner eigenen Währung bezahlen, da die meisten Zahlungsanbieter die Umrechnung gegen eine geringe Gebühr (in der Regel ein paar Cent) für dich übernehmen. PayPal erhebt keine Gebühren für die Umrechnung.",
        "premium.faq.guilds.title": "Für wie viele Discord-Server ist mein Abonnement gültig?",
        "premium.faq.guilds.text": "Ein Abonnement ist für einen einzelnen Discord-Server gültig. Wenn du Premium für mehrere Server erhalten möchten, benötigst du ein Abonnement für jeden Server.",
        "premium.faq.invoice.title": "Kann ich eine Rechnung für meine Zahlung erhalten?",
        "premium.faq.invoice.text": 'Ja! Nachdem du dich angemeldet hast, kannst du alle deine Rechnungen im Tab "Abrechnung" (im Dropdown-Menü deines Profils oben rechts auf der Seite) einsehen und herunterladen. Sie sollten für fast alle Zwecke gültig sein, auch für die Geschäftsbuchhaltung. Wenn du Hilfe mit einer Rechnung benötigst, kontaktiere uns bitte.',
        "premium.faq.money.title": "Wofür wird das Geld verwendet?",
        "premium.faq.money.text": "MEE6 ist ein echtes Unternehmen, das von echten Menschen geführt wird. Die Prämie ist das, was es am Leben erhält. Wir verwenden das Geld, um unseren Entwicklern Gehälter zu zahlen und um Hosting-Kosten und Steuern zu decken.",
        "premium.faq.payment.title": "Welche Zahlungsmethoden werden unterstützt?",
        "premium.faq.payment.text": "Derzeit unterstützen wir nur Kreditkarten, Debitkarten und PayPal. Bitte beachte, dass die Transaktion möglicherweise nicht funktioniert, wenn dein PayPal-Konto nicht verifiziert ist.",
        "premium.faq.premium.title": "Was ist MEE6 Premium?",
        "premium.faq.premium.text": "MEE6 Premium ist ein Abonnement, mit dem du die Entwicklung des Bots unterstützen kannst. Es ist nicht zwingend erforderlich, um MEE6 zu verwenden, aber es ermöglicht dir, exklusive Funktionen freizuschalten, wenn du es kaufst.",
        "premium.faq.refund.title": "Kann ich eine Rückerstattung erhalten, wenn ich es nicht mag?",
        "premium.faq.refund.text": "Wir möchten, dass jeder eine gute Erfahrung mit MEE6 Premium macht. Wenn du in der ersten Woche nicht zufrieden bist, kontaktiere uns bitte und du erhältst eine volle Rückerstattung.",
        "premium.faq.secure.title": "Ist meine Zahlung sicher?",
        "premium.faq.secure.text": "Ja. Wir haben niemals Zugang zu Ihren Debit-/Kreditkartendaten. Zahlungen werden über Stripe oder Checkout.com abgewickelt, zwei Zahlungsabwickler, denen Millionen von Unternehmen weltweit vertrauen und die durch modernste Technologien geschützt sind. Wir haben auch keinen Zugriff auf deine PayPal-Kontodaten und deine Transaktionen sind durch den PayPal-Käuferschutz geschützt.",
        "premium.faq.stop.title": "Kann ich mein Abonnement jederzeit beenden?",
        "premium.faq.stop.text": 'Ja. Du kannst dein Abonnement jederzeit beenden, indem du zum Tab "Abrechnung" gehst. Dein Abonnement bleibt bis zum Ende des Zeitraums, für den du bezahlt hast, gültig, wird dir aber nicht mehr in Rechnung gestellt.',
        "premium.faq.transfer.title": "Kann ich mein Premium-Abonnement auf einen anderen Server übertragen?",
        "premium.faq.transfer.text": "Ja. Sobald du ein Abonnement abgeschlossen hast, kannst du es auf einen anderen Server übertragen {link}.",
