        "walletConnect.faq.title": "Häufig gestellte Fragen",
        "walletConnect.faq.q1": "Warum muss ich meine Brieftasche anschließen?",
        "walletConnect.faq.a1": "Sie müssen sich mit Ihrer Brieftasche verbinden, um den Besitz und das Vermögen der Brieftasche zu verifizieren, so dass Sie, wenn Sie berechtigt sind, eine exklusive Rolle auf dem Discord-Server erhalten können!",
        "walletConnect.faq.q2": "Ist Metamask die einzige verfügbare Brieftasche?",
        "walletConnect.faq.a2": "Im Moment ist Metamask die einzige Möglichkeit, eine Verbindung zu Ihrer Brieftasche herzustellen, ja. Metamask ist dafür bekannt, einfach zu bedienen und sehr sicher zu sein... eine Priorität für uns! Obwohl wir die Erfahrung auf MEE6 kontinuierlich verbessern, werden wir in Zukunft weitere Geldbörsen unterstützen.",
        "walletConnect.faq.q3": "Warum muss ich bei Metamask unterschreiben?",
        "walletConnect.faq.a3": "Um zu bestätigen, dass Sie der rechtmäßige Besitzer Ihrer Brieftasche sind, benötigen wir eine einfache Unterschrift, um Sie als solchen zu identifizieren. Dies ist eine Nur-Lese-Verbindung, wir werden nie nach weiteren Informationen fragen. Als grundlegende Sicherheitsregel gilt: Bitte geben Sie NIEMALS Ihre privaten Schlüssel oder Ihre Seed-Phrase weiter.",
