        "landing.homepage.meta.description": "Erstellen Sie den besten Discord-Server mit MEE6, dem besten All-in-One Discord-Bot, dem Millionen von Servern weltweit vertrauen. Verbessern Sie Ihre Community mit fortschrittlichen Funktionen wie Willkommensnachrichten, benutzerdefinierten Befehlen, Benachrichtigungen über soziale Medien, Moderation und mehr. Schaffen Sie ein einzigartiges und ansprechendes Erlebnis für Ihre Mitglieder. Starten Sie noch heute mit MEE6 und bringen Sie Ihren Discord-Server auf die nächste Stufe.",
        "landing.reactionRoles.meta.description": "Fügen Sie mit dem MEE6-Bot ganz einfach Reaktionsrollen zu Ihrem Discord-Server hinzu. Weisen Sie Nutzern spezielle Rollen zu, die auf ihrer ausgewählten Emoji- oder Button-Reaktion basieren, und passen Sie die eingebettete Nachricht vollständig an Ihre Community an. Wählen Sie den einfachsten und zuverlässigsten Weg, Reaktionsrollen mit MEE6 zu verwalten.",
        "landing.reactionRoles.subtitle": "MEE6-REAKTIONSROLLEN-PLUGIN",
        "landing.reactionRoles.title": "Der Bot, mit dem du Reaktionsrollen ganz einfach auf deinem Server hinzufügen kannst",
        "landing.reactionRoles.description": "Nutze den MEE6 Bot als einfachen Weg, um deinen Nutzern spezielle Rollen auf deinem Server zu geben.",
        "landing.reactionRoles.what-is-it.subtitle": "Wie es funktioniert",
        "landing.reactionRoles.what-is-it.title": "Was ist eine Reaktionsrolle auf Discord?",
        "landing.reactionRoles.what-is-it.description": "Stellen Sie sich vor, Sie möchten wissen, welche Sprache die Menschen in Ihrer Community sprechen. Mit Reaction Roles können Sie eine Frage senden und die Leute mit verschiedenen Emojis antworten lassen. Je nachdem, welches Emoji sie auswählen, wird ihnen eine bestimmte Rolle zugewiesen. Und genau das können Sie mit dem Reaction Roles Bot tun.",
        "landing.reactionRoles.what-is-it.cta": "Beginn der Verwendung von Reaktionsrollen",
        "landing.reactionRoles.card1.subtitle": "Einfache Lösung",
        "landing.reactionRoles.card1.title": "Wie verwende ich die Reaktionsrolle in meinem Discord?",
        "landing.reactionRoles.card1.description": "Es ist zwar möglich, diese manuell hinzuzufügen, aber die große Mehrheit der Mitglieder entscheidet sich für den Bot. Er macht alles einfacher und zuverlässiger.",
        "landing.reactionRoles.card2.subtitle": "Funktionen",
        "landing.reactionRoles.card2.title": "Welcher Discord-Bot ist am besten für die Reaktionsrolle geeignet?",
        "landing.reactionRoles.card3.subtitle": "Einfach zu bedienen",
        "landing.reactionRoles.card3.title": "Der einfachste Weg, Rollen für Reaktionen hinzuzufügen",
        "landing.reactionRoles.card3.description": "Mit MEE6 können Sie zwischen Emoji und Schaltflächenreaktion wählen. Aber das ist noch nicht alles - Sie können Ihre eingebettete Nachricht auch vollständig gestalten, damit sie für Ihre Mitglieder perfekt ist.",
        "landing.giveaway.meta.description": "Mache deinen Discord-Server mit dem MEE6 Gewinnspiel-Plugin noch interessanter. Organisiere und verwalte Gewinnspiele in deiner Community und belohne deine Mitglieder mit spannenden Preisen. Mit anpassbaren Feldern und Befehlen macht es der MEE6 Gewinnspiel-Bot einfach, ein erfolgreiches Gewinnspiel auf Discord durchzuführen. ",
        "landing.giveaway.subtitle": "MEE6 GEWINNSPIEL-PLUGIN",
        "landing.giveaway.title": "Der perfekte Bot zur Organisation von Gewinnspielen auf Discord",
        "landing.giveaway.description": "Verwalte ein Gewinnspiel ganz einfach mit dem MEE6 Discord Bot.",
        "landing.giveaway.what-is-it.subtitle": "Wie es funktioniert",
        "landing.giveaway.what-is-it.title": "Was ist ein Gewinnspiel-Bot auf Discord?",
        "landing.giveaway.what-is-it.description": "Ein Discord-Giveaway ist ein Wettbewerb auf der Discord-Chatplattform, bei dem die Teilnehmer Preise gewinnen können. Der beste Weg, ein Giveaway auf Discord einzurichten, ist die Verwendung des MEE6 Giveaway-Plugins! Die Organisation eines Discord-Giveaways ermöglicht es Ihnen, Leute auf Ihren Server zu locken und eine loyale Community aufzubauen.",
        "landing.giveaway.what-is-it.cta": "Beginnen Sie mit der Erstellung von Gewinnspielen",
        "landing.giveaways.card1.subtitle": "WAS IST EIN GEWINNSPIEL-BOT",
        "landing.giveaways.card1.title": "Belohne deine Gemeinschaft auf <discord-logo></discord-logo> Discord",
        "landing.giveaways.card1.description": "Der Bot hilft dir, Gewinnspiele in deiner Community zu erstellen, zu verwalten und zu verfolgen. Egal, ob du mehrere Gewinner, Rollenanpassungen oder coole Einbettungen brauchst, es ist alles da.",
        "landing.giveaways.card2.subtitle": "Plug and Play",
        "landing.giveaways.card2.title": "Verwenden MEE6 für dein nächstes Discord-Gewinnspiel",
        "landing.giveaways.card2.description": "Auch wenn Sie MEE6 noch nie benutzt haben, müssen Sie nicht jedes Plugin installieren. Gehen Sie direkt zum Giveaway-Plugin, konfigurieren Sie die gewünschten Felder und starten Sie das Giveaway schnell!",
        "landing.giveaways.card2.cta": "Erstelle dein erstes Gewinnspiel",
        "landing.giveaways.card3.subtitle": "Problemlos",
        "landing.giveaways.card3.title": "Discord Gewinnspiele mit /commands",
        "landing.giveaways.card3.description": "Nachdem Sie Ihren Bot eingerichtet haben, erhalten Ihre Server-Mitglieder die von Ihnen erstellte Einbettung und können dort direkt an der Verlosung teilnehmen. Mit unseren Befehlen können Sie ganz einfach einen neuen Gewinner auswählen, indem Sie /reroll ausführen.",
        "landing.setupMee6.title": "MEE6 einrichten und den besten Discord-Server in wenigen Minuten aufbauen",
        "landing.setupMee6.cta": "Zu Discord hinzufügen",
