        "ai.faq.ai.title": "Was ist MEE6 AI?",
        "ai.faq.ai.text": "MEE6 AI ist das KI-Angebot von MEE6. Mit MEE6 AI-Abonnements kannst du die Befehle /imagine und /write auf jedem Server verwenden, auf dem MEE6 installiert ist, und zwar im Rahmen der in deinem Abonnement enthaltenen Generierungen.",
        "ai.faq.refund.title": "Kann ich eine Rückerstattung erhalten, wenn es mir nicht gefällt?",
        "ai.faq.refund.text": "Wir möchten, dass jeder eine großartige Erfahrung mit MEE6 AI macht. Wenn du innerhalb der ersten 14 Tage nicht zufrieden bist, kontaktiere uns bitte und du erhältst eine volle Rückerstattung.",
        "ai.faq.guilds.title": "Für wie viele Discord-Server oder Accounts ist mein Abonnement gültig?",
        "ai.faq.guilds.text": "MEE6 AI Community-Abonnements gelten nur für einen Server. Wenn du es auf mehreren Servern aktivieren möchtest, musst du ein zusätzliches Abonnement kaufen. MEE6 AI Personal-Abonnements gelten nur für dein persönliches Konto, nicht für alle Personen auf den von dir verwalteten Servern.",
        "ai.faq.stop.title": "Kann ich mein Abonnement jederzeit beenden?",
        "ai.faq.stop.text": 'Ja. Du kannst dein Abonnement jederzeit beenden, indem du zum Tab "Abrechnung" gehst. Dein Abonnement bleibt bis zum Ende des Zeitraums, für den du bezahlt hast, gültig, wird dir aber nicht mehr in Rechnung gestellt.',
        "ai.faq.payment.title": "Welche Zahlungsmethoden werden unterstützt?",
        "ai.faq.payment.text": "Derzeit unterstützen wir nur Kreditkarten, Debitkarten und PayPal. Bitte beachte, dass die Transaktion möglicherweise nicht funktioniert, wenn dein PayPal-Konto nicht verifiziert ist.",
        "ai.faq.currency.title": "Kann ich in einer anderen Währung bezahlen?",
        "ai.faq.currency.text": "Die einzige verfügbare Währung ist die angezeigte Währung. Du kannst jedoch auch in deiner eigenen Währung bezahlen, da die meisten Zahlungsanbieter die Umrechnung gegen eine geringe Gebühr (in der Regel ein paar Cent) für dich übernehmen. PayPal erhebt keine Gebühren für die Umrechnung.",
        "ai.faq.invoice.title": "Kann ich eine Rechnung für meine Zahlung erhalten?",
        "ai.faq.invoice.text": 'Ja! Nachdem du dich angemeldet hast, kannst du alle deine Rechnungen im Tab "Abrechnung" (im Dropdown-Menü deines Profils oben rechts auf der Seite) einsehen und herunterladen. Sie sollten für fast alle Zwecke gültig sein, auch für die Geschäftsbuchhaltung. Wenn du Hilfe mit einer Rechnung benötigst, kontaktiere uns bitte.',
        "ai.faq.money.title": "Wofür wird das Geld verwendet?",
        "ai.faq.money.text": "MEE6 ist ein echtes Unternehmen, das von echten Menschen geführt wird. MEE6 AI ist Teil der Produkte, die es am Leben erhalten. Wir verwenden das Geld, um unseren Entwicklern Gehälter zu zahlen und um Hosting-Kosten und Steuern zu decken.",
        "ai.faq.secure.title": "Ist meine Zahlung sicher?",
        "ai.faq.secure.text": "Ja. Wir haben niemals Zugang zu Ihren Debit-/Kreditkartendaten. Zahlungen werden über Stripe oder Checkout.com abgewickelt, zwei Zahlungsabwickler, denen Millionen von Unternehmen weltweit vertrauen und die durch modernste Technologien geschützt sind. Wir haben auch keinen Zugriff auf deine PayPal-Kontodaten und deine Transaktionen sind durch den PayPal-Käuferschutz geschützt.",
        "ai.faq.models.title": "Welche KI-Modelle verwendet ihr?",
        "ai.faq.models.text": "Für /imagine verwenden wir proprietäre Technologie und selbst entwickelte Modelle. Für /write verwenden wir OpenAI und versuchen, sie so aktuell wie möglich zu halten.",
        "ai.faq.private.title": "Was ist der private Modus?",
        "ai.faq.private.text": "Die von den Benutzern im privaten Modus (verfügbar mit dem Ultra-Abonnement) erstellten Generierungen werden niemals als Kommunikations- oder Präsentationsmaterial verwendet.",
        "ai.faq.dm.title": 'Was bedeutet "DM-Nutzung"?',
        "ai.faq.dm.text": "Mit der DM-Nutzung kannst du /imagine und /write verwenden, indem du eine Unterhaltung mit MEE6 in deinen Direktnachrichten führst. Auf diese Weise siehst nur du die generierten Inhalte.",
        "plugins.google_alerts.name": "Google Alarm",
        "plugins.google_alerts.description": "Willst du wissen, dass du berühmt wirst? Setze einen einen Alarm und sieh sofort, wenn du oder deine Community erwähnt wird.",
